?AMENDED AND RESTATED
SHARED FACILITIES AGREEMENT
THIS AMENDED AND RESTATED SHARED FACILITIES AGREEMENT (this “Agreement”), is entered into as of February 20, 2025 (the “Effective Date”), by and between Minco Wind Interconnection Services, LLC, a Delaware limited liability company (“Minco Interconnection”), Minco Wind I, LLC, a Delaware limited liability company (“Minco I”), Minco Wind Energy  II, LLC, a Delaware limited liability company (“Minco II”), and Minco II Energy Storage, LLC, a Delaware limited liability company (“Minco II Storage”, and together with Minco Interconnection, Minco I, and Minco II, the “Parties” and each a “Party”).
RECITALS
WHEREAS, Minco I (successor in interest to Minco Wind, LLC) owns and operates a wind energy generation facility with a nameplate capacity of 99.2 MW (net) (the “Minco I Project”);
WHEREAS, Minco II (successor in interest to Minco Wind II, LLC) owns and operates a wind energy generation facility with a nameplate capacity of 100.8 MW (net) (the “Minco II Project”);
WHEREAS, Minco Interconnection entered into that certain Second Revised Amended and Restated Generator Interconnection Agreement by and among itself, Southwest Power Pool (“SPP”) and Oklahoma Gas and Electric Company (“OGE”), dated as of January 14, 2022 (“LGIA”); 
WHEREAS, Minco Interconnection owns certain personal property, fixtures, equipment and/or facilities (including the Interconnection Customer’s Interconnection Facilities, as identified in Appendix A to the LGIA) described in Exhibit A attached hereto (the “Shared Facilities”) that are necessary to interconnect the Minco I Project and the Minco II Project to the electric transmission system of OGE; 
WHEREAS, Minco I, Minco II and Minco Interconnection entered into that certain Shared Facilities Agreement, dated November 2, 2011 (“Original Shared Facilities Agreement”), to allow Minco I and Minco II to use the Shared Facilities and to enable Minco I and Minco II to be able to inject the output of the Projects into the electric transmission system of OGE; 
WHEREAS, Minco II Storage is developing and will own and operate a four (4) hour 65 MW battery energy storage project (the “Minco II Storage Project”, and together with the Minco I Project and the Minco II Project, the “Projects” and each a “Project”) using surplus interconnection service available under the LGIA pursuant to that certain Surplus Interconnection Service Generator Interconnection Agreement, dated March 25, 2024, as may be amended, by and among itself, Minco Interconnection, SPP, and OGE (the “Surplus LGIA”) which provides for surplus interconnection services for the Minco II Storage Project; and
WHEREAS, Minco I, Minco II, Minco II Storage, and Minco Interconnection wish to amend and restate the Original Shared Facilities Agreement to allow Minco II Storage, Minco I and Minco II to use the Shared Facilities and to enable Minco I, Minco II, and Minco II Storage to be able to inject the output of the Projects into the electric transmission system of OGE.
NOW THEREFORE, in consideration of the premises and of the mutual covenants and agreements contained herein, and for other good and valuable consideration, the receipt and sufficiency of which is hereby acknowledged, the Parties hereby agree to amend and restate the Original Shared Facilities Agreement in its entirety as follows:
AGREEMENT
1. TERM; EARLY TERMINATION
1.1 Term.  As of the Effective Date, this Agreement shall supersede the Original Shared Facilities Agreement, and the term of this Agreement shall commence on the Effective Date and shall continue in effect until terminated (a) by mutual agreement of the Parties, or (b) pursuant to Section 1.2 of this Agreement.
1.2 Early Termination.  This Agreement shall automatically terminate, without further action by either Party and without further liability of any Party to any other Party (except for obligations accruing prior to the termination), upon the date that each of Minco I, Minco II and Minco II Storage, or their successors and assigns, shall have permanently ceased operation of their respective Projects for the production of electric energy.
2. GRANT OF SHARED FACILITIES RIGHTS
2.1 Grant.  Minco Interconnection hereby grants to Minco I, Minco II and Minco II Storage, respectively, during the term of this Agreement, and on the terms and subject to the conditions hereof, the non-exclusive right to access and utilize the Shared Facilities as may be reasonably necessary in connection with the interconnection service received by Minco Interconnection from SPP and OGE, and ownership, operation and maintenance by Minco I, Minco II and Minco II Storage of their respective Projects.
2.2 Essential Nature.  Minco Interconnection hereby acknowledges that the right of Minco I, Minco II and Minco II Storage to access and utilize the Shared Facilities are essential to the production and delivery of electric energy from the respective Projects to the electric transmission system of OGE.
2.3 Vesting.  The right to access and utilize the Shared Facilities granted hereunder by Minco Interconnection to Minco I, Minco II and Minco II Storage, respectively, shall vest in each of Minco I, Minco II and Minco II Storage, respectively, as a contracting party hereunder without any transfer of title, leasehold or other interest or rights in the Shared Facilities.  
2.4 	License Fee. In consideration of the right to access and utilize the Shared Facilities, each of Minco I, Minco II and Minco II Storage agrees to pay to Minco Interconnection a one-time license fee (the “License Fee”) based on each such Party’s pro rata share of the total, aggregate costs, fee and expenses incurred by Minco Interconnection for development, real estate rights, and engineering, procurement and construction of the Shared Facilities, with such pro rata being Minco I (40.7%), Minco II (41.0%) and Minco II Storage (18.3%). Any previous payments between the Parties relating to these costs, fees and expenses shall be applied against payments due under this section.  

3. NATURE OF SHARED FACILITIES RIGHTS
3.1 Nature of Services.  Minco Interconnection shall provide certain services to Minco I, Minco II, and Minco II Storage consisting of those services Minco Interconnection receives through the LGIA, as necessary to enable the energy generated by the Minco I Project, Minco II Project, and Minco II Storage Project to reach the transmission system.  The Parties acknowledge that the grant of rights under this Agreement by Minco Interconnection to Minco I, Minco II and Minco II Storage is made for the purpose of enabling the energy from Minco I, Minco II and Minco II Storage to reach the transmission system of OGE.  For the avoidance of doubt, the grant of rights under this Agreement by Minco   Interconnection to Minco I, Minco II, and Minco II Storage shall not relieve Minco Interconnection of its obligations under the LGIA.
3.2 Obligations of Minco Interconnection.  Minco Interconnection shall exercise its rights, provide the coordination service and perform its obligations under this Agreement in a manner consistent with its obligations under the LGIA.  Without limiting the generality of the foregoing, during the term of this Agreement, Minco Interconnection agrees to:
(i) perform its obligations under this Agreement and the LGIA in accordance with Good Utility Practice, Applicable Laws and Regulations and Applicable Reliability Standards, in each case as defined in the LGIA, and in a manner consistent with the terms of the LGIA;
(ii) comply with all provisions of the LGIA to which it is subject (and all insurance requirements, payments due, operational limits, operating guides, operating procedures and reliability standards and requirements applicable by virtue thereof); 
(iii) promptly provide to Minco I any notices it receives under the LGIA from SPP or OGE, including any notices regarding emergencies under Article 13 of the LGIA and promptly provide to Minco II Storage any notices it receives under the Surplus LGIA from SPP or OGE;
(iv) not take any action, without prior written consent of Minco I and Minco II, to terminate the LGIA, or take any action, without Minco II Storage’s written consent, to terminate the Surplus LGIA.  
(v) perform necessary maintenance on the Shared Facilities, as agreed to in this Agreement; and 
(vi) ensure that, to the maximum extent practicable, any actions by Minco II that may, or do, cause Minco Interconnection to fail to comply with the LGIA, do not affect the coordination service received by Minco I hereunder. 
3.3 Obligations of Minco I. Minco I shall exercise its rights and perform its obligations under this Agreement in a manner that is reasonable and facilitates Minco Interconnection’s performance under, and compliance with, the LGIA.  Without limiting the generality of the foregoing, during the term of this Agreement, Minco I agrees to:
(i) operate the Minco I Project in accordance with Good Utility Practice, Applicable Laws and Regulations and Applicable Reliability Standards, in each case as defined in the LGIA, and in a manner consistent with the terms of the LGIA;
(ii) facilitate Minco Interconnection’s compliance with all provisions of the LGIA (including, without limitation, all insurance requirements, operational limits, operating guides, operating procedures and reliability standards and requirements applicable by virtue thereof) as related to the Minco I Project;  
(iii) not take any action (or refrain from taking any action) which would result in a breach of the LGIA by Minco Interconnection;  
(iv) use all commercially reasonable efforts to promptly resolve any technical issues arising in connection with the operation of the Minco I Project that might reasonably be expected to result in a default under the LGIA, and if such default occurs, to promptly assist Minco Interconnection to cure such default in accordance with the terms of the LGIA; 
(v) comply with all instructions, as may be communicated to it by Minco Interconnection, in order to ensure compliance with the provisions of the LGIA with respect to the Minco I Project; 
(vi) provide Minco Interconnection with all reasonable information regarding the operation and condition of the Minco I Project required for Minco Interconnection to maintain compliance with the terms and conditions of the LGIA; and
(vii) provide promptly to Minco Interconnection copies of all notices and instructions received by it that affect Minco Interconnection’s performance under the LGIA. 
3.4 Obligations of Minco II. Minco II shall exercise its rights and perform its obligations under this Agreement in a manner that is reasonable and facilitates Minco Interconnection’s performance under, and compliance with, the LGIA.  Without limiting the generality of the foregoing, during the term of this Agreement, Minco II agrees to:
(i) operate the Minco II Project in accordance with Good Utility Practice, Applicable Laws and Regulations and Applicable Reliability Standards, in each case as defined in the LGIA, and in a manner consistent with the terms of the LGIA;
(ii) facilitate Minco Interconnection’s compliance with all provisions of the LGIA (including, without limitation, all insurance requirements, operational limits, operating guides, operating procedures and reliability standards and requirements applicable by virtue thereof) as related to the Minco II Project;  
(iii) not take any action (or refrain from taking any action) which would result in a breach of the LGIA by Minco Interconnection;  
(iv) use all commercially reasonable efforts to promptly resolve any technical issues arising in connection with the operation of the Minco II Project that might reasonably be expected to result in a default under the LGIA, and if such default occurs, to promptly assist Minco Interconnection to cure such default in accordance with the terms of the LGIA; 
(v) comply with all instructions, as may be communicated to it by Minco Interconnection, in order to ensure compliance with the provisions of the LGIA with respect to the Minco II Project; 
(vi) provide Minco Interconnection with all reasonable information regarding the operation and condition of the Minco II Project required for Minco Interconnection to maintain compliance with the terms and conditions of the LGIA; and
(vii) provide promptly to Minco Interconnection copies of all notices and instructions received by it that affect Minco Interconnection’s performance under the LGIA. 
3.5 Obligations of Minco II Storage. Minco II Storage shall exercise its rights and perform its obligations under this Agreement in a manner that is reasonable and facilitates Minco Interconnection’s performance under, and compliance with, the LGIA.  Without limiting the generality of the foregoing, during the term of this Agreement, Minco II Storage agrees to:
(viii) operate the Minco II Storage Project in accordance with Good Utility Practice, Applicable Laws and Regulations and Applicable Reliability Standards, in each case as defined in the Surplus LGIA, and in a manner consistent with the terms of the Surplus LGIA;
(ix) facilitate Minco Interconnection’s compliance with all provisions of the LGIA (including, without limitation, all insurance requirements, operational limits, operating guides, operating procedures and reliability standards and requirements applicable by virtue thereof) as related to the Minco II Storage Project;  
(x) not take any action (or refrain from taking any action) which would result in a breach of the Surplus LGIA by Minco Interconnection;  
(xi) use all commercially reasonable efforts to promptly resolve any technical issues arising in connection with the operation of the Minco II Storage Project that might reasonably be expected to result in a default under the LGIA, and if such default occurs, to promptly assist Minco Interconnection to cure such default in accordance with the terms of the Surplus LGIA; 
(xii) comply with all instructions, as may be communicated to it by Minco Interconnection, in order to ensure compliance with the provisions of the Surplus LGIA with respect to the Minco II Storage Project; 
(xiii) provide Minco Interconnection with all reasonable information regarding the operation and condition of the Minco II Storage Project required for Minco Interconnection to maintain compliance with the terms and conditions of the Surplus LGIA; and
(xiv) provide promptly to Minco Interconnection copies of all notices and instructions received by it that affect Minco Interconnection’s performance under the Surplus LGIA. 
3.6 No Joint and Several Liability.  The Parties acknowledge that this Agreement does not subject Minco I to joint and several liability for any actions taken by Minco II or Minco II Storage, does not subject Minco II to joint and several liability for any actions taken by Minco I or Minco II Storage, and does not subject Minco II Storage to joint and several liability for any actions taken by Minco I or Minco II.
3.7 Assignment or Transfer of Rights.  Except as set forth in Section 10.6 hereof, Minco   I, Minco II and Minco II Storage, respectively, shall not assign or transfer any rights granted to such Party hereunder with regard to the Shared Facilities, or grant any permission, license, right of way or similar right with regard to the Shared Facilities, without the prior written consent of Minco  Interconnection.
3.8 Interference.  Subject to the terms of this Agreement, in no event shall any Party be entitled to exercise its rights to access and utilize the Shared Facilities if the exercise of such rights would materially interfere with or limit the reasonable and necessary access and utilization of the Shared Facilities by any other Party. 
3.9 Prior Written Consent.  Except as set forth in this Agreement, Minco   Interconnection shall not take any action that results in the forbearance, foreclosure, termination or alteration of the respective rights or increases the obligations or responsibilities of Minco   I, Minco II or Minco II Storage of access to, utilization of or reliance upon the Shared Facilities without the prior written consent of Minco   I, Minco II, and Minco II Storage.  
4. MAINTENANCE OF SHARED FACILITIES
4.1 Allocation of Certain Costs and Expenses.
(i) Minco Interconnection shall be responsible for the operation, inspection, maintenance, repair, alteration, relocation, improvement and replacement of the Shared Facilities; provided, however, that the Parties hereby agree that (a) the costs and expenses of the operation, inspection, maintenance, repair, alteration, relocation, improvement and replacement of the Shared Facilities and of insuring the Shared Facilities, and (b) costs that Minco Interconnection is responsible for under the LGIA, including potential costs under section 10.5 of the LGIA for operations and maintenance expenses, and which are not directly caused by only Minco I, Minco II or Minco II Storage, shall be shared between Minco I, Minco II and Minco II Storage on a pro rata basis, with Minco I paying 40.7% of the costs and expenses, Minco II paying 41.0% of the costs and expenses, and Minco II Storage paying 18.3% of the costs and expenses.  Each of Minco I, Minco   II and Minco II Storage shall pay its respective allocation (specified above) of such costs and expenses to Minco Interconnection within ten (10) days of receipt from Minco Interconnection of each written notice specifying such costs and expenses.
(ii) Minco I, Minco II and Minco II Storage shall each be liable to pay for the station power service of their respective Projects.
4.2 Successor Agreement.  In the event that the Shared Facilities are no longer operated and maintained by a single entity for any reason, the Parties agree to use good faith efforts to negotiate mutually agreeable terms and execute a mutually agreeable agreement (or amendment to this Agreement) that specifies the division of responsibilities of the entities providing operation and maintenance services associated with the Shared Facilities.
5. CHANGE IN LAW
5.1 Change in Law. In the event that a change in the laws or regulations applicable to the Shared Facilities, any of the Projects, or this Agreement requires the amendment, modification or replacement of this Agreement in order to satisfy any applicable federal, state or local regulatory requirements, the Parties agree to use good faith efforts to negotiate and implement mutually agreeable terms to accomplish such amendment, modification or replacement.  
6. CERTAIN COVENANTS
6.1 Authority and Operational Abilities.  Each of the Parties represents, as of the Effective Date, and covenants for the term of this Agreement, that such Party has the legal authority and operational abilities to fulfill its obligations under this Agreement.
6.2 Agreement to Cooperate.  Each Party agrees to reasonably cooperate with the other Parties so that, subject to the terms of this Agreement, each Project benefits from the full utilization and enjoyment of the Shared Facilities as is necessary for the efficient operation of each such Project.
6.3 Adverse Events.  
(i) If an operational issue arises at the Minco I Project, the Minco II Project or the Minco II Storage Project that is reasonably expected to result in a material breach by Minco Interconnection of the LGIA or this Agreement (an “Adverse Event”), Minco Interconnection shall curtail the Project that is causing the Adverse Event. In the event of such curtailment, energy deliveries to the to the Point of Interconnection from the Project that has caused the Adverse Event shall be limited as necessary until the Adverse Event has been cured in the reasonable judgment of Minco Interconnection.
(ii) If, as a direct result of an Adverse Event caused by the Minco I Project or the Minco II Project or the Minco II Storage Project, Minco Interconnection incurs costs, expenses, or penalties of any kind (“AE Costs”), Minco I or Minco II or Minco II Storage, as applicable, shall be solely responsible for reimbursing Minco Interconnection for such AE Costs.  In the event that multiple Projects are responsible for the Adverse Event, and to the extent that Minco Interconnection, in its sole and absolute discretion, can accurately allocate responsibility for such Adverse Event between the Projects, Minco I, Minco II and Minco II Storage shall be responsible for only its allocable portion of such applicable AE Costs.  If, however, it is not reasonably possible for Minco Interconnection, as determined in its sole and absolute discretion, to accurately allocate such responsibility, Minco I shall be liable for 40.7% of such AE Costs, Minco II shall be liable for 41.0% of such AE Costs, and Minco II Storage shall be liable for 18.3% of such AE Costs.  
6.4 Priority of Curtailment.	Notwithstanding anything to the contrary in this Agreement, in the event of curtailment pursuant to the LGIA or Surplus LGIA (or pursuant to applicable operating guides or applicable reliability standards and requirements), Minco Interconnection shall curtail the Projects to be as follows:
(i) first, and if necessary in full, any Project (if any) the operation of which is contributing to an OGE or SPP system emergency; and
(ii) thereafter, all Projects, at the same time and to an extent for each Project equal to such Project’s pro rata portion (based on such Project’s nameplate capacity) of the energy delivered to the Point of Interconnection as of the time immediately prior to the event giving rise to the curtailment; provided, that the calculation of each Project’s pro rata portion shall be subject to, and be determined after giving effect to, the Existing Interconnection Customer’s limited grant of Surplus Interconnection Service (each as defined in the Surplus LGIA) to Minco II Storage Project as set forth in the Surplus LGIA.   
6.5 Metering Protocol.	The Parties agree that Minco Interconnection shall implement the Minco I & II Wind BESS Addition Power Loss & Generation Allocation Meter Protocol, Rev 4 September 17, 2024, set forth in Exhibit B attached hereto, as amended from time to time, for the allocation of losses and generation among the Projects.

7. MATERIAL BREACH; LIMITATIONS
7.1 Material Breach by any Party.  In the event of any material breach of this Agreement by any Party and such Party fails to cure promptly such breach within a reasonable time not to exceed thirty (30) days after receipt of written notice from any other, non-defaulting Party describing such breach, the non-defaulting Party shall have the right, but not the obligation, in addition to all remedies available to it at law or in equity, to (i) cure the breach on behalf of the defaulting Party, or (ii) suspend the breaching Party’s access to all or any portion of the Shared Facilities owned by such non-breaching Party for so long as such default shall be continuing and remain uncured.  Notwithstanding the foregoing, in the event that a breach of this Agreement could give rise to a breach by Minco Interconnection pursuant to the terms of the LGIA, the non-defaulting Party shall not be required to provide the defaulting Party with notice and/or an opportunity to cure in order to exercise the remedies specified in clause (i) or (ii) above; provided, that the remedy specified in clause (i) may be exercised, without prejudice to any right or remedy of any Party hereunder, by any lender of such Party.  If a Party (or any lender thereof) chooses to cure a Party’s default, the defaulting Party shall reimburse the non-defaulting Party (or such Party’s lender) upon demand for all commercially reasonable costs incurred by the non-defaulting Party (or such Party’s lender) in curing such default. 
7.2 Except for indemnification obligations related to third-party claims as provided for in Section 10.7, in no event shall any Party be liable under any provision of this Agreement for any losses, damages, costs or expenses for any special, indirect, incidental, consequential, or punitive damages including, but not limited to, loss of profit or revenue, loss of the use of equipment, cost of capital, cost of temporary equipment or services, whether based in whole or in part in contract, in tort, including negligence, strict liability, or any other theory of liability.
8. FORCE MAJEURE
8.1 Force Majeure.  In the event of an act of God, government order or restraint, war (declared or undeclared) or warlike conditions, act of terrorism, blockade, revolution, strike, lockout, civil commotion, fire, flood, storm, epidemic or any other occurrence beyond a Party’s reasonable control (each a “Force Majeure Event”), such Party shall promptly notify each other Party thereof and, so long as such condition shall persist, such Party shall not be liable for the delay in performance of, or the failure to perform, its obligations (other than obligations for payment of amounts due hereunder) under this Agreement caused directly or indirectly thereby.  The claiming Party shall give each other Party notice describing the particulars of the Force Majeure Event.  Within fifteen (15) days after giving notice of the Force Majeure Event, the claiming Party shall give each other Party an estimate of the Force Majeure Event’s expected duration and probable impact.  The claiming Party shall continue to furnish each other Party with timely regular reports during the continuation of the Force Majeure Event.  Each Party shall promptly exercise commercially reasonable efforts to mitigate or limit the impact to its obligations hereunder as a result of the Force Majeure Event.

9. LENDER PROTECTIONS
9.1 Applicability Generally. The following provisions are for the benefit of any natural person, domestic or foreign corporation, limited liability company, general or limited partnership, joint venture, association, joint stock company, business trust, estate, trust, enterprise, unincorporated organization, government authority or any other legal or commercial entity providing loans, other credit or bond facilities, hedging facilities or other financing (including any tax equity financing) under any financing, hedge or credit agreements, note purchase agreements, bond indentures or lease agreement, in each case, for the financing (including any tax equity financing) or refinancing of the development, construction, operation or maintenance of the Projects or the Shared Facilities, as applicable (the “Lenders”) (if any) of each Party, and shall apply to a Party while there exists any outstanding amount payable, or any performance required, by such Party to such Party’s Lender.  Once a Party has indefeasibly paid all of the outstanding amounts payable to, and rendered all performance required by such Party to its Lender, then such Party shall provide prompt notice to the other Parties thereof and, solely with respect to that Party, all references in this Agreement to the Lender shall be deemed null and void and all such provisions shall, without any further actions, have no further force and effect; provided, however, that such provisions shall be revived if such Party assigns its interest in this Agreement as collateral security to a Lender in connection with a further financing transaction and gives notice of the identity and contact information of such Lender to the other Parties.
9.2 Cure Rights. The following provisions are for the benefit of the Lenders (if any) of each Party, and provided upon the occurrence of an uncured event of default by a Party, or if such Party should dissolve or be subject to a voluntary or involuntary bankruptcy, such Party’s Lender shall have the right, but not the obligation to (a) make any payments due under this Agreement by such Party; and (b) do any other act or thing on behalf of such Party that may be necessary or appropriate to be done in the performance and observance of the terms hereof.  All payments so made, and all things so done and performed, by a Lender on behalf of such Party shall be as effective to prevent or cure any breach or default as they would have been if made, done and performed by such Party, and each Party agrees to accept such performance, payment and cure by such Lender acting in place of such Party.  Each Party agrees to make all payments (if any) to be made by it to a defaulting Party directly to such defaulting Party’s Lender upon receipt of the Lender’s written instructions to that effect.
9.3 Amendment. Each Party agrees for the benefit of a Lender (if any) of the other Party that it will not, without the prior written consent of such Lender (which consent shall be given or withheld on the basis of the documents governing the relationship between such Lender and such other Party) amend, modify or waive or take any action causing, consenting to or accepting the amendment, modification or waiver of any provision of this Agreement.
9.4 Default Notices. Each Party shall deliver to a Lender (if any) of the defaulting Party a duplicate copy of any and all notices of default that it may from time to time deliver to a defaulting Party hereunder, and such copies shall be delivered to such Lender at the same time such notices of default are delivered to such defaulting Party.  No such notice of default shall be deemed to have been given to a defaulting Party hereunder unless and until a copy thereof shall have been given to the defaulting Party’s Lenders.
9.5 Failure to Cure. Upon a defaulting Party’s failure to cure any event of default hereunder within the time provided in Section 7.1 hereof (including any extended cure periods which may be applicable thereunder), then the Lender (if any) of such defaulting Party shall have an additional sixty (60) days after expiration of such cure period to cure such event of default; provided, however, that if such default cannot reasonably be cured within such additional sixty (60) day period, then such Lender shall have such additional time to cure such default as may be reasonably necessary; provided, further, that such cure period shall in no event, unless otherwise provided herein, be extended beyond one hundred eighty (180) days.  Any event of default that cannot be cured by such Lender shall nevertheless be deemed to have been cured and remedied if (a) on or before sixty (60) days after receiving such notice of default, such Lender (or its designee) shall have acquired (i) control of the defaulting Party, or (ii) the defaulting Party’s then-remaining right, title and interest in and to this Agreement and any individually owned defaulting Party assets used in connection with the defaulting Party’s Project (collectively, the “Project Assets”), or shall have commenced foreclosure or other appropriate proceedings for such purposes and shall be prosecuting such proceedings to completion with commercially reasonable diligence, and (b) promptly upon obtaining control of the defaulting Party or the defaulting Party’s then-remaining Project Assets, subject to Section 9.9 hereof, the defaulting Party’s Lender (or its designee) assumes in writing, and commences performance of, the obligations of the defaulting Party hereunder.  All rights of the Parties to terminate this Agreement as a result of the occurrence of an event of default hereunder shall be expressly conditioned upon (i) the defaulting Party’s Lender having first received a copy of the notice of default as and when provided in Section 9.4 hereof and (ii) the Lender having failed to cure the event of default or acquire possession of the defaulting Party or the defaulting Party’s Project Assets or commence foreclosure or other appropriate proceedings as set forth, and within the time specified, in this Section 9.5.
9.6 Extension of Time to Cure. If a Lender is prohibited by any process or injunction issued by, or by reason of any action of, any court having jurisdiction over any bankruptcy, reorganization, insolvency or other debtor-relief proceeding from commencing or prosecuting foreclosure or other appropriate proceedings, then the times specified in Section 9.5 hereof for commencing or prosecuting such foreclosure or other proceedings shall be extended for the period of such prohibition.
9.7 Consent to Transfer. The transfer of (i) control of a defaulting Party, or (ii) a defaulting Party’s Project Assets or any part thereof, to the defaulting Party’s Lender and/or to one or more purchasers or grantees (a) at a foreclosure sale by judicial or nonjudicial foreclosure and sale, (b) by a conveyance in lieu of foreclosure or (c) by any other assignment or conveyance, including by such Lender or such other purchaser(s) or grantee(s) following foreclosure and sale, or as a result of any other legal proceeding, shall not require the consent of the other Parties, and such other Parties agree that upon such foreclosure, sale, conveyance, assignment or other proceeding, it shall recognize the Lender or such other purchaser(s) or grantee(s) as the successor to the defaulting Party under this Agreement; provided, however, that, subject to Section 9.9 hereof, the Lender or such purchaser(s) or grantee(s) assumes the obligations of the defaulting Party under this Agreement.
9.8 New Agreement. In the event that this Agreement is terminated without Lender’s written consent for any reason other than an event of default which could have been but was not cured by the Lender as provided in this Article 9, and if, within sixty (60) days after receiving notice of such termination, the Lender shall so request, then, so long as the Lender is making commercially reasonable efforts to cure any event of default by the defaulting Party as provided herein, the other Parties shall execute and deliver to the Lender or its designee one or more new agreements, which new agreement(s) shall be on the same terms and conditions as this Agreement for the remaining term of this Agreement before giving effect to such termination.
9.9 Liability of Lender. A defaulting Party’s Lender or any such purchaser(s) or grantee(s) described in Section 9.7 hereof shall not have any duty, obligation or liability under this Agreement prior to the time of its entry into physical possession of the Project Assets or its commencement of performance of a defaulting Party’s obligations under this Agreement or under a new agreement entered into as provided in Section 9.8 hereof, and shall not otherwise be required to perform (or be subject to any defenses or offsets by reason of) any defaulting Party’s other obligations under this Agreement that were unperformed at such time.  In the event that the defaulting Party’s Lender elects to perform a defaulting Party’s obligations under this Agreement or to enter into a new agreement as provided in Section 9.8 hereof, then the Lender shall not have any personal liability to any Party for the performance of such obligations, and the sole recourse of such Parties in seeking the enforcement of such obligations shall be to the Lender’s interest in the defaulting Party’s Project Assets.  In the event that the Lender assigns its interest in this Agreement or a new agreement entered into pursuant to Section 9.8 hereof to any purchaser(s) or grantee(s) described in Section 9.7 hereof, then the Lender shall be released from any further liability hereunder, provided that such purchaser(s) or grantee(s) assume the obligations of the defaulting Party under this Agreement arising after the Lender’s entry into physical possession or the Lender’s commencement of performance of the defaulting Party’s obligations.  
9.10 Cooperation. A Party shall, upon not less than ten (10) days prior written notice from any other Party or such other Party’s Lender, execute an estoppel certificate (a) certifying that this Agreement is in full force and effect and has not been modified except as specified in this Agreement or as set forth in such certificate, (b) certifying that, to such Party’s knowledge, there are no uncured events of default under this Agreement (or, if any such uncured events of default exist, stating with particularity the nature thereof), and (c) containing any other certifications as may reasonably be requested by a Lender and agreed to by such Party.  In addition, a Party shall, upon not less than thirty (30) days prior written notice from any Lender to another Party or from another Party, and at such other Party’s expense, execute and deliver such other documents as may be reasonably requested by such Lender or Party, including consents to assignment, legal opinions and similar agreements or instruments.
9.11 Assumption in Writing. Subject to Section 9.9 of this Agreement, each Party agrees to have its successor under this Agreement assume in writing its obligations under this Agreement; provided, however, that nothing contained herein shall be deemed a consent by any Lender to any assignment that is prohibited, or to which any Lender may withhold its consent under any applicable financing documents. 
10. MISCELLANEOUS
10.1 Relationship of Parties.  The Parties do not intend to create hereby any joint venture, partnership, association or any other entity for the conduct of any business.  Except as provided in Section 7.1, nothing herein shall be deemed to authorize any Party to act on behalf of any other Party.
10.2 Non-Interference.  Each Party agrees not to interfere with the reasonable and necessary utilization of the Shared Facilities by any other Party as permitted hereunder.
10.3 Modification and Amendment.   The terms of this Agreement may only be modified or amended in a writing signed by all of the Parties.
10.4 Waiver.  The failure of a Party to insist upon or enforce strict performance of any of the provisions of this Agreement or to exercise any rights or remedies under this Agreement shall not be construed as a waiver or relinquishment to any extent of such Party’s right to assert or rely upon any such provisions, rights, and remedies in that or any other instance; rather, the same shall be and remain in full force and effect.
10.5 Enforceability.   Any provision of this Agreement which is prohibited or unenforceable in any jurisdiction shall, as to such jurisdiction, be ineffective only to the extent of such prohibition, but shall be effective to the extent of such remaining provisions hereof.
10.6 Assignment.  No Party may assign any of its benefits, rights or obligations hereunder to any third party without the prior written consent of each other Party, provided, however, that any Party may collaterally assign this Agreement to any lender in connection with a financing or a refinancing of its respective Project.
10.7 Indemnification.  Each Party shall indemnify, defend and hold each other Party, its officers, directors, shareholders, members and affiliates, harmless from any and all damages, losses, claims, including claims and actions relating to injury to or death of any person or damage to property, demand, suits, recoveries, costs and expenses, court costs, attorney fees, and all other obligations by or to third parties, arising out of or resulting from the indemnifying Party’s performance or non-performance of its obligations under this Agreement, except in cases of gross negligence or intentional wrongdoing, by the indemnified Party.  
10.8 Choice of Law, Jurisdiction and Waiver of Jury Trial
(i)	This Agreement and the rights and obligations of the Parties hereunder will be governed pursuant to, and enforced, construed and interpreted in accordance with, the laws of the State of New York without regard to principles of conflicts of laws (other than Section 5-1401 of the General Obligations Law of the State of New York).  Venue for resolution of any disputes under this Agreement shall be New York County, New York.
	(ii)		Each of the Parties irrevocably and unconditionally submits to the exclusive jurisdiction of the United States District Court for the Southern District of New York for the purposes of any suit, action or other proceeding arising out of or relating to this Agreement, the transactions contemplated hereby, any provision hereof or the breach, performance, enforcement or validity or invalidity of this Agreement or any provision hereof (and agrees not to commence any suit, action or proceeding relating thereto except in such courts).  
(iii)		THE PARTIES HERETO EACH HEREBY KNOWINGLY, VOLUNTARILY AND INTENTIONALLY WAIVE THE RIGHT EACH MAY HAVE TO A TRIAL BY JURY WITH RESPECT TO ANY PROCEEDINGS BASED HEREON, OR ARISING OUT OF, UNDER OR IN CONNECTION WITH THIS AGREEMENT, OR ANY COURSE OF CONDUCT, COURSE OF DEALING, STATEMENTS (WHETHER ORAL OR WRITTEN) OR ACTIONS OF EITHER PARTY TO THIS AGREEMENT.  THIS PROVISION IS A MATERIAL INDUCEMENT FOR THE PARTIES TO ENTER INTO THIS AGREEMENT.
10.9 Inspection of Records.   Each Party shall have access to any records concerning the Shared Facilities held by any other Party upon reasonable notice and at reasonable times. 
10.10 Entire Agreement.  This Agreement constitutes the entire agreement of the Parties with respect to the subject matter hereof.
10.11 Section Headings.  The section headings in this Agreement are for convenience of reference only and shall not modify, define, expand, or limit any of the terms or provisions hereof.
10.12 Counterparts.  This Agreement may be executed in one or more counterparts, each of which when so executed shall be deemed an original, and all of which when taken together shall constitute one and the same instrument.
10.13 Specific Performance.  The Parties hereto may demand specific performance of this Agreement.  Each Party hereby irrevocably waives any defense based on the adequacy of a remedy at law and any other defense which might be asserted to bar the remedy of specific performance.
